import React from 'react'
import syst from './image/system.png'
import  style from'./Home.module.css'
const Home = () => {
  const backgroundStyle = {
    backgroundImage: 'https://img.freepik.com/free-photo/business-man-owner-company-office_1303-16046.jpg',
    backgroundSize: 'cover',
    // backgroundPosition: 'center',
    backgroundRepeat: 'no-repeat',
    height: '100vh',
    width: '100%',
  };

  return (<div style={backgroundStyle}>
  <div className='ghg'></div>
    <img src='https://img.freepik.com/free-photo/business-man-owner-company-office_1303-16046.jpg' alt='data not this' className='system'/>
 </div> )
}

export default Home
